import { GoogleLogin } from '@react-oauth/google'
import axios from 'axios'
import { useState } from 'react'

export default function Logon() {
	const [showLogin, setShowLogin] = useState(false)

	const responseSucess = async response => {
		const { credential } = response

		try {
			// Відправка токену на бекенд для перевірки та створення сесії
			const res = await axios.post('http://localhost:4000/api/google-login', {
				token: credential,
			})

			console.log('login is successful', res.data)
			setShowLogin(true)
		} catch (error) {
			console.error('login failed', error)
		}
	}

	const responseFailure = () => {
		console.log('login is not successful')
	}

	return (
		<div className='App'>
			{!showLogin && (
				<GoogleLogin
					clientId='YOUR_GOOGLE_CLIENT_ID'
					onSuccess={responseSucess}
					onFailure={responseFailure}
				/>
			)}
		</div>
	)
}
